const valores = {
    uno: 1,
    dos: 2,
    tres: 3
 }

const initialState = {
    Amount : 12
}

export const amountReducer = (state = initialState, action) => {
    switch (action.type) {
        case valores.uno:
            return {...state, Amount : 12}
            break
        case valores.dos:
            return {...state, Amount : 15}
            break
        case valores.tres:
            return {...state, Amount : 18}
            break
        
        default:
            return state
            break
    }
    
}
